【商品説明】<br>●『髪ヤケド防止』できるアイロン・コテ用スタイリングミスト。br●アイロン・コテ使用時の髪ヤケド（キューティクルが水ぶくれ状になるダメージ）を防止し、髪をいためずキメたスタイルを一日中キープ。br●ダメージ補修成分（アミノ酸：アルギニン、グルタミン酸Na）配合。br●紫外線から守るUVカット。br●湿気コントロール。br●ふんわり香るフルーティアロマ。br<br><br>商品サイズ：58×209×40<br><br>成分：水、エタノール、ジメチコンコポリオール、ＢＧ、ＰＥＧ－２０、シクロヘキサン－１４－ジカルボン酸ビスエトキシジグリコール、グリコシルトレハロース、γ－ドコサラクトン、ステアルトリモニウムクロリド、ＰＥＧ－６０水添ヒマシ油、ダイズステロール、（アクリレーツ／アクリル酸ステアリル／メタクリル酸エチルアミンオキシド）コポリマー、（ＶＰ／メタクリルアミド／ビニルイミダゾール）コポリマー、グルタミン酸Ｎａ、アルギニン、プロパンジオール、クオタニウム－１８、ベヘントリモニウムクロリド、イソプロパノール、加水分解水添デンプン、メトキシケイヒ酸エチルヘキシル、クエン酸Ｎａ、クエン酸、香料<br><br>ご使用上の注意等：・頭皮に異常がある時には使用しないでください。br・刺激等の異常が現れた時は使用を中止し、皮フ科専門医等へのご相談をおすすめします。br・乳幼児の手の届かないところに置いてください。br・目に入った時はすぐに洗い流してください。br・高温になる場所や直射日光のあたる場所には置かないでください。br・アイロン・コテは機器の取扱説明書にしたがってお使いください。<br><br>原産国：日本<br><br>発売元、製造元、輸入元又は販売元：〒108-8080東京都港区海岸３－２０－２０　ヨコソーレインボータワー７Ｆ　クラシエホームプロダクツ販売株式会社　お客様センター　電話番号　03-5446-3210　※受付時間　９：００～１７：００（土日祝、各窓口休業日を除く）<br>区分：化粧品<br>JANコード：4901417666116<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
